import React, { Component } from 'react'
import styled from 'styled-components'
import Gallery from "react-photo-gallery"

const GalleryWrapper = styled.div`
  width: 90vw;
`

class PhotoGallery extends Component {

  render () {
    const photos = [
      {
        src: 'https://i.imgur.com/rgEBWy4.png',
        width: 3,
        height: 4
      },
      {
        src: 'https://i.imgur.com/ur5syqw.jpg',
        width: 4,
        height: 3
      },
      {
        src: 'https://i.imgur.com/Nn71L2v.png',
        width: 3,
        height: 4
      },
      {
        src: 'https://i.imgur.com/sihuEgl.png',
        width: 3,
        height: 4
      },
      {
        src: 'https://i.imgur.com/0Mlt80v.png',
        width: 3,
        height: 4
      },
      {
        src: 'https://i.imgur.com/8Mw2ZWZ.jpg',
        width: 4,
        height: 3
      }
    ];
    return (
        <Gallery photos={this.photos} direction={"column"} />
    )
  }
}

export default PhotoGallery
